import io

def create_excel_download(
    df_case1_analysis,
    df_case2_analysis,
    df_systems_case1,
    df_systems_case2,
    debug_dfs=None
):
    """
    Create an in-memory Excel file (as bytes) containing multiple sheets:
      - df_case1_analysis => "Case1_Analysis"
      - df_case2_analysis => "Case2_Analysis"
      - df_systems_case1  => "Systems_Case1"
      - df_systems_case2  => "Systems_Case2"
      - debug_dfs         => Possibly multiple debug dataframes, one per material
    """
    output = io.BytesIO()
    with pd.ExcelWriter(output, engine="openpyxl") as writer:
        if df_case1_analysis is not None and not df_case1_analysis.empty:
            df_case1_analysis.to_excel(writer, sheet_name="Case1_Analysis", index=False)
        if df_case2_analysis is not None and not df_case2_analysis.empty:
            df_case2_analysis.to_excel(writer, sheet_name="Case2_Analysis", index=False)
        if df_systems_case1 is not None and not df_systems_case1.empty:
            df_systems_case1.to_excel(writer, sheet_name="Systems_Case1", index=False)
        if df_systems_case2 is not None and not df_systems_case2.empty:
            df_systems_case2.to_excel(writer, sheet_name="Systems_Case2", index=False)
        if debug_dfs is not None:
            for material, dbg_df in debug_dfs.items():
                if dbg_df is not None and not dbg_df.empty:
                    sheet_name = f"Debug_{material[:20]}"
                    dbg_df.to_excel(writer, sheet_name=sheet_name, index=False)
    processed_data = output.getvalue()
    return processed_data

has_data = False
if df_case1_analysis is not None and not df_case1_analysis.empty:
    has_data = True
if df_case2_analysis is not None and not df_case2_analysis.empty:
    has_data = True
if df_systems_case1 is not None and not df_systems_case1.empty:
    has_data = True
if df_systems_case2 is not None and not df_systems_case2.empty:
    has_data = True
if debug_info:
    for mat, dbg_df in debug_info.items():
        if dbg_df is not None and not dbg_df.empty:
            has_data = True
            break

if has_data:
    excel_bytes = create_excel_download(
        df_case1_analysis,  # from Step 1
        df_case2_analysis,  # from Step 1
        df_systems_case1,   # from Step 3
        df_systems_case2,   # from Step 3
        debug_dfs=debug_info
    )
    st.download_button(
        label="Download All Results (Excel)",
        data=excel_bytes,
        file_name="All_Results.xlsx",
        mime="application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"
    )
else:
    st.info("No data is available to download. Please upload and generate results first.")

