# 10) Total Work Calculation and Comparison
###############################################################################
st.header("Total Work Calculation and Comparison")

# 1) Ask the user for total quantity
total_qty = st.number_input(f"Enter Total Quantity of Work (in {declared_unit}):", min_value=0.0, value=100.0)

# 2) Ensure we have df_systems_case1 from Step 3
if total_qty > 0 and df_systems_case1 is not None and not df_systems_case1.empty and "System" in df_systems_case1.columns:
    
    # Make a copy so we can add columns
    df_totals = df_systems_case1.copy()

    # Some columns might not exist if they were dropped, so ensure they exist:
    for col in ["Primary", "SM1", "SM2", "SM3", "SM4", "SM5"]:
        if col not in df_totals.columns:
            df_totals[col] = "N/A"

    # Build a display name that includes the system number, PM, and SMs
    def build_display_name(row):
        parts = [f"{row['System']}: PM={row['Primary']}"]
        for sm_col in ["SM1","SM2","SM3","SM4","SM5"]:
            if sm_col in row and row[sm_col] != "N/A":
                parts.append(f"{sm_col}={row[sm_col]}")
        return " | ".join(parts)

    if "DisplayName" not in df_totals.columns:
        df_totals["DisplayName"] = df_totals.apply(build_display_name, axis=1)

    # Multiply per-unit values by total quantity and convert from MJ->GJ, kg->ton
    ee_col = f"EE (MJ/{declared_unit})"
    ec_col = f"EC (kg CO₂eq./{declared_unit})"
    df_totals["Total EE (GJ)"] = (df_totals[ee_col] * total_qty) / 1000
    df_totals["Total EC (TonCO₂ eq.)"] = (df_totals[ec_col] * total_qty) / 1000

    # 3) Use the base-case system from Step 4 if available, else fallback
    base_system = st.session_state.get("base_case_selection", df_totals["System"].iloc[0])
    base_row = df_totals[df_totals["System"] == base_system].iloc[0]
    base_total_ee = base_row["Total EE (GJ)"]
    base_total_ec = base_row["Total EC (TonCO₂ eq.)"]

    # 4) Let the user pick a second system for comparison
    comparison_choice = st.selectbox(
        "Select another system for comparison:",
        options=df_totals["DisplayName"].tolist()
    )
    comparison_row = df_totals[df_totals["DisplayName"] == comparison_choice].iloc[0]
    comp_total_ee = comparison_row["Total EE (GJ)"]
    comp_total_ec = comparison_row["Total EC (TonCO₂ eq.)"]

    # Identify extremes in the entire DataFrame
    least_ee_row = df_totals.loc[df_totals["Total EE (GJ)"].idxmin()]
    highest_ee_row = df_totals.loc[df_totals["Total EE (GJ)"].idxmax()]
    least_ec_row = df_totals.loc[df_totals["Total EC (TonCO₂ eq.)"].idxmin()]
    highest_ec_row = df_totals.loc[df_totals["Total EC (TonCO₂ eq.)"].idxmax()]

    def diff_abs_and_pct(value, base):
        diff = value - base
        pct = (diff / base * 100) if base != 0 else None
        return diff, pct

    # Differences from the base system
    ee_diff_least, ee_pct_least = diff_abs_and_pct(least_ee_row["Total EE (GJ)"], base_total_ee)
    ee_diff_high, ee_pct_high = diff_abs_and_pct(highest_ee_row["Total EE (GJ)"], base_total_ee)
    ec_diff_least, ec_pct_least = diff_abs_and_pct(least_ec_row["Total EC (TonCO₂ eq.)"], base_total_ec)
    ec_diff_high, ec_pct_high = diff_abs_and_pct(highest_ec_row["Total EC (TonCO₂ eq.)"], base_total_ec)

    # Differences for the second system
    ee_diff_comp, ee_pct_comp = diff_abs_and_pct(comp_total_ee, base_total_ee)
    ec_diff_comp, ec_pct_comp = diff_abs_and_pct(comp_total_ec, base_total_ec)

    summary_data = {
        "System": [
            base_system,
            least_ee_row["System"],
            highest_ee_row["System"],
            least_ec_row["System"],
            highest_ec_row["System"],
            comparison_row["System"]
        ],
        "Description": [
            "Base Case",
            "Least Total EE",
            "Highest Total EE",
            "Least Total EC",
            "Highest Total EC",
            "Comparison System"
        ],
        "Total EE (GJ)": [
            base_total_ee,
            least_ee_row["Total EE (GJ)"],
            highest_ee_row["Total EE (GJ)"],
            None,
            None,
            comp_total_ee
        ],
        "EE Difference (GJ)": [
            None,
            ee_diff_least,
            ee_diff_high,
            None,
            None,
            ee_diff_comp
        ],
        "EE Difference (%)": [
            None,
            ee_pct_least,
            ee_pct_high,
            None,
            None,
            ee_pct_comp
        ],
        "Total EC (TonCO₂ eq.)": [
            base_total_ec,
            None,
            None,
            least_ec_row["Total EC (TonCO₂ eq.)"],
            highest_ec_row["Total EC (TonCO₂ eq.)"],
            comp_total_ec
        ],
        "EC Difference (TonCO₂ eq.)": [
            None,
            None,
            None,
            ec_diff_least,
            ec_diff_high,
            ec_diff_comp
        ],
        "EC Difference (%)": [
            None,
            None,
            None,
            ec_pct_least,
            ec_pct_high,
            ec_pct_comp
        ]
    }
    df_summary = pd.DataFrame(summary_data)

    # Round numeric columns to 0 decimals
    numeric_cols = [
        "Total EE (GJ)",
        "EE Difference (GJ)",
        "EE Difference (%)",
        "Total EC (TonCO₂ eq.)",
        "EC Difference (TonCO₂ eq.)",
        "EC Difference (%)"
    ]
    for col in numeric_cols:
        df_summary[col] = df_summary[col].apply(lambda x: round(x, 0) if pd.notna(x) else None)

    st.subheader("Total Work Comparison Summary")
    st.dataframe(df_summary)

else:
    st.info("Enter a total quantity of work to calculate total EE & EC values.")

